CREATE DEFINER=`root`@`localhost` PROCEDURE `staff_work_statistic`(in_year int, in_month int)
BEGIN
	declare exist, ind  int default NULL;
    select id into ind from REPORT_DATES where year = in_year and month = in_month;
    if ind is not null then
		select exists(select * from REPORTs_staff where report_date_id = id) into exist;
	else 
    begin
		insert into report_dates values(NULL, in_year, in_month);
        select id into ind from REPORT_DATES where year = in_year and month = in_month; 
	end;
    end if;
    -- if there are no reports made on this date
	IF EXIST = 0 or EXIST is NULL THEN
		Insert into reports_staff
        Select
			null									as id,
			id_s									AS staff_id,
			FIO										as FIO, 
			outt.cnt								as proto_closed, 
			count(*) 								as tests_done,
            ind										as report_date_id
		from test_protocol tp
			join list_of_testing on id_p = protocol_id
			join (
				Select id_staff, count(*) as cnt
				from test_protocol
				where year(date_t) = in_year and month(date_t) = in_month
				group by id_staff
			) outt on outt.id_staff = tp.id_staff
            join staff on outt.id_staff = id_s
		where year(date_t) = in_year and month(date_t) = in_month
		group by tp.id_staff;
	END IF;
END ;;
